import React from 'react';

const ReviewList = ({ reviews }) => {
	return (
		<div className='reviewList'>
			<h2>Reviews</h2>
			<div>
				<h3>4.9</h3>
				<h3> 399 Reviews</h3>
			</div>
			<div className='container'>
				{reviews.map((review, i) => {
					return <div></div>;
				})}
			</div>
			<span>Show All ></span>
		</div>
	);
};

export default ReviewList;
